import React, { useState } from "react";
const OptimizeTest = () => {
  const [count, setCount] = useState(1);
  const [obj, setObj] = useState({
    count: 1,
  });

  return (
    <div style={{ padding: 50 }}>
      <div>
        <h2> Counter A </h2>
        <button onClick={() => setCount(count)}>A button</button>
      </div>
      <div>
        <h2> Counter B </h2>
        <button
          onClick={() =>
            setObj({
              count: obj.count,
            })
          }
        >
          B button
        </button>
      </div>
    </div>
  );
};

export default OptimizeTest;
